import React from 'react';

export default function SingleSong(props) {
  let minutes = Math.floor(props.length);
  let seconds = (props.length * 60) % 60;

  return (
    <tr className="singleSong">
      <th>{props.title}</th>
      <th>{props.artist}</th>
      <th>{props.album}</th>
      <th>
        {minutes}:{seconds}
      </th>
      <th>
        <button>{`<`}</button>
        {props.upvotes}
        <button>{`>`}</button>
      </th>
    </tr>
  );
}
